import React from 'react';
import '../css/Menu.css';

class Menu extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      menuOpen: false
    }

  }

  setOpen() {
    console.log(1)
    var {menuOpen} = this.state;
    this.setState({menuOpen: !menuOpen});
  }

  render() {
    return (
      <div className="menu-btn" onClick={this.setOpen}>
        <div className="menu-btn_burger"></div>
      </div>
  )
} 
}

export default Menu;
